import React from "react";
import { Helmet } from "react-helmet";
import TradingViewWidget, { Themes } from 'react-tradingview-widget';

const ChartPanel = () => {
    return (
        <TradingViewWidget
            symbol="NASDAQ:AAPL"
            theme={Themes.DARK}
            locale="fr"
            autosize
        />
    )
}

export default ChartPanel
